import React,{Component} from "react";
import "./slide.css"
import Slider from "react-slick";


class Slide extends Component {
    constructor(props){
        super(props)
            this.state({
                settings   
            })

    }

    render(){
        return(
            <div>
            <Slider {...settings}></Slider>
            </div>
        )
    }
}
export default Slide;
